import React, { useEffect } from 'react'
import CarouselComponent from '../components/CarouselComponent'
function Home({props}) {
return (
<div>
    {useEffect(()=>{
        props.setProgress(40)
    })}
    <CarouselComponent/>
</div>
)
}

export default Home
